(12,	'estimate',	'estimate-already-send',	'english',	'Estimate Already Sent to Customer',	'Signature Impact Windows & Doors: Follow Up',	'<div><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Hi,&nbsp;{contact_firstname}&nbsp;{contact_lastname}</span></div>\r\n<div><br /><span style=\"font-size: 12pt;\"><span style=\"font-size: 12pt;\">&nbsp;I hope this email finds you well. I wanted to follow up on my previous email regarding the Impact Windows &amp; Doors proposal for your home. We\'d like to know if you have any feedback or any questions. Please do not hesitate to reach out. Looking forward to your response 305.205.1770<br /><br /></span></span>\r\n<div>\r\n<p class=\"p1\"><span class=\"s1\">You can accept the estimate at the following link:&nbsp;</span><a href=\"{estimate_link}\">{estimate_number}</a></p>\r\n</div>\r\n<br /><br /></div>\r\n<div><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Best&nbsp;Regards,</span></div>\r\n<div><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">&nbsp;</span></div>\r\n<div><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">{email_signature}</span></div>\r\n<div><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">&nbsp;</span></div>\r\n<div><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">&nbsp;</span></div>\r\n<div><span style=\"font-family: arial, helvetica, sans-serif; font-size: 12pt;\">&nbsp;</span></div>',	'{companyname}',	'jen@signatureimpactwindows.net',	0,	1,	0),
