(885,	'client',	'client-statement',	'english',	'Statement - Account Summary',	'Account Statement from {statement_from} to {statement_to}',	'Dear {contact_firstname} {contact_lastname}, <br /><br />Its been a great experience working with you.<br /><br />Attached with this email is a list of all transactions for the period between {statement_from} to {statement_to}<br /><br />For your information your account balance due is total:&nbsp;{statement_balance_due}<br /><br />Please contact us if you need more information.<br /> <br />Kind regards,<br /> <br />{email_signature}',	'{companyname} | CRM',	'',	0,	1,	0),
(886,	'ticket',	'ticket-assigned-to-admin',	'english',	'New Ticket Assigned (Sent to Staff)',	'New support ticket has been assigned to you',	'<p><span style=\"font-size: 12pt;\">Hi.</span></p>\r\n<p><span style=\"font-size: 12pt;\">A new support ticket&nbsp;has been assigned to you.</span><br /> <br /><span style=\"font-size: 12pt;\"><strong>Subject</strong>: {ticket_subject}</span><br /><span style=\"font-size: 12pt;\"><strong>Department</strong>: {ticket_department}</span><br /><span style=\"font-size: 12pt;\"><strong>Priority</strong>: {ticket_priority}</span><br /> <br /><span style=\"font-size: 12pt;\"><strong>Ticket message:</strong></span><br /><span style=\"font-size: 12pt;\">{ticket_message}</span><br /> <br /><span style=\"font-size: 12pt;\">You can view the ticket on the following link: <a href=\"{ticket_url}\">#{ticket_id}</a></span><br /> <br /><span style=\"font-size: 12pt;\">Kind Regards,</span><br /><span style=\"font-size: 12pt;\">{email_signature}</span></p>',	'{companyname} | CRM',	'',	0,	1,	0),
(887,	'client',	'new-client-registered-to-admin',	'english',	'New Customer Registration (Sent to admins)',	'New Customer Registration',	'Hello.<br /><br />New customer registration on your customer portal:<br /><br /><strong>Firstname:</strong>&nbsp;{contact_firstname}<br /><strong>Lastname:</strong>&nbsp;{contact_lastname}<br /><strong>Company:</strong>&nbsp;{client_company}<br /><strong>Email:</strong>&nbsp;{contact_email}<br /><strong>Phone: </strong>{contact_phonenumber}<br /><br />Best Regards',	'{companyname} | CRM',	'',	0,	1,	0),
(888,	'leads',	'new-web-to-lead-form-submitted',	'english',	'Web to lead form submitted - Sent to lead',	'{lead_name} - We Received Your Request',	'Hello {lead_name}.<br /><br /><strong>Your request has been received.</strong><br /><br />This email is to let you know that we received your request and we will get back to you as soon as possible with more information.<br /><br />Best Regards,<br />{email_signature}',	'{companyname} | CRM',	'',	0,	0,	0),
(889,	'staff',	'two-factor-authentication',	'english',	'Two Factor Authentication',	'Confirm Your Login',	'<p>Hello {staff_firstname}</p>\r\n<p style=\"text-align: left;\">You received this email because you have enabled two factor authentication in your account.<br />Use the following code to confirm your login:</p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 18pt;\"><strong>{two_factor_auth_code}<br /><br /></strong><span style=\"font-size: 12pt;\">{email_signature}</span><strong><br /><br /><br /><br /></strong></span></p>',	'{companyname} | CRM',	'',	0,	1,	0),
(890,	'project',	'project-finished-to-customer',	'english',	'Project Marked as Finished (Sent to Customer Contacts)',	'Project Marked as Finished',	'<p>Hello&nbsp;{contact_firstname}&nbsp;{contact_lastname}</p>\r\n<p>You are receiving this email because project&nbsp;<strong>{project_name}</strong> has been marked as finished. This project is assigned under your company and we just wanted to keep you up to date.<br /><br />You can view the project on the following link:&nbsp;<a href=\"{project_link}\">{project_name}</a></p>\r\n<p>If you have any questions don\'t hesitate to contact us.<br /><br />Kind Regards,<br />{email_signature}</p>',	'{companyname} | CRM',	'',	0,	1,	0),
(891,	'credit_note',	'credit-note-send-to-client',	'english',	'Send Credit Note To Email',	'Credit Note With Number #{credit_note_number} Created',	'Dear&nbsp;{contact_firstname}&nbsp;{contact_lastname}<br /><br />We have attached the credit note with number <strong>#{credit_note_number} </strong>for your reference.<br /><br /><strong>Date:</strong>&nbsp;{credit_note_date}<br /><strong>Total Amount:</strong>&nbsp;{credit_note_total}<br /><br /><span style=\"font-size: 12pt;\">Please contact us for more information.</span><br /> <br /><span style=\"font-size: 12pt;\">Kind Regards,</span><br /><span style=\"font-size: 12pt;\">{email_signature}</span>',	'{companyname} | CRM',	'',	0,	1,	1),
(892,	'staff',	'reminder-email-staff',	'english',	'Staff Reminder Email',	'You Have a New Reminder!',	'<p>Hello&nbsp;{staff_firstname}<br /><br /><strong>You have a new reminder&nbsp;linked to&nbsp;{staff_reminder_relation_name}!<br /><br />Reminder description:</strong><br />{staff_reminder_description}<br /><br />Click <a href=\"{staff_reminder_relation_link}\">here</a> to view&nbsp;<a href=\"{staff_reminder_relation_link}\">{staff_reminder_relation_name}</a><br /><br />Best Regards<br /><br /></p>',	'{companyname} | CRM',	'',	0,	1,	0),
